  input: TEXT,SB23,SB23.37557,"On 02/08/01, the Laborers' Political League, to which
    we are an affiliated fund, made a contribution to Congressman Gephardt's Leadership
    Committee entitled 'The Effective Government Committee' in the amount of $5,000.
    In filing their report, the Laborers' Political League software incorrectly attributed
    the $5,000 contribution to the 'Gephardt in Congress Committee'. The Laborers'
    Political League is submitting an amendment to their report indicating that the
    $5,000 contribution was to 'The Effective Government Committee' not the 'Gephardt
    in Congress Committee'. This change will eliminate the issue of an excess contribution
    to Congressman Gephardt's Congressional Committee by the Midwest Region Laborers'
    Political League."
